// src/components/AddCase.js
import React, { useState } from 'react';
import './AddCase.css';
import Navbar from './Navbar';
import Footer from './Footer';

const AddCase = () => {
    const [caseType, setCaseType] = useState('');
    const [description, setDescription] = useState('');
    const [province, setProvince] = useState('');
    const [date, setDate] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Handle form submission logic here
        console.log({ caseType, description, province, date });
    };

    return (
        <div>
            <Navbar />
            <div className="add-case-background">
                <div className="add-case-container">
                    <div className="add-case-form">
                        <h2>Add Case</h2>
                        <form onSubmit={handleSubmit}>
                            <div className="form-group">
                                <label htmlFor="caseType">Case Type</label>
                                <select
                                    id="caseType"
                                    value={caseType}
                                    onChange={(e) => setCaseType(e.target.value)}
                                >
                                    <option value="">Select Case Type</option>
                                    <option value="criminal">Criminal</option>
                                    <option value="civil">Civil</option>
                                    <option value="family">Family</option>
                                    <option value="labor">Labor</option>
                                    <option value="others">Others</option>
                                </select>
                            </div>
                            <div className="form-group">
                                <label htmlFor="description">Description</label>
                                <textarea
                                    id="description"
                                    placeholder="Enter description"
                                    value={description}
                                    onChange={(e) => setDescription(e.target.value)}
                                />
                            </div>
                            <div className="form-group">
                                <label htmlFor="province">Province</label>
                                <select
                                    id="province"
                                    value={province}
                                    onChange={(e) => setProvince(e.target.value)}
                                >
                                    <option value="">Select Province</option>
                                    <option value="province1">Province 1</option>
                                    <option value="province2">Province 2</option>
                                    <option value="province3">Province 3</option>
                                    <option value="province4">Province 4</option>
                                    <option value="province5">Province 5</option>
                                </select>
                            </div>
                            <div className="form-group">
                                <label htmlFor="date">Date</label>
                                <input
                                    id="date"
                                    type="date"
                                    value={date}
                                    onChange={(e) => setDate(e.target.value)}
                                />
                            </div>
                            <button type="submit" className="btn-primary">Submit</button>
                        </form><br />
                        <div className="data-protection">
                            <h3>We Protect Your Data</h3>
                            <p>Your data is secure with us. Don't worry.</p>
                        </div>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
};

export default AddCase;
